public void init()
{
    //find or create params
    DevAxRefreshDataParameters::find();
    super();
}

private void enableControls()
{
    str urlD365Prod = DevAxRefreshDataParameters.UrlD365Prod;

    if (urlD365Prod)
    {
        urlD365Prod = new System.Uri(urlD365Prod).Host;

        str currentUrl = URLUtility::getUrl();
        currentUrl = new System.Uri(currentUrl).Host;

        boolean enableUrl = currentUrl != urlD365Prod;

        DevAxRefreshDataReplaceAfipParams.enabled(enableUrl);
        DevAxRefreshDataRetailButtonsReplaceActionProps.enabled(enableUrl);
    }
    else
    {
        DevAxRefreshDataReplaceAfipParams.enabled(false);
        DevAxRefreshDataRetailButtonsReplaceActionProps.enabled(false);
    }
}

public System.Byte[] ReadFullyBytes(System.IO.Stream input)
{
    int read;
    System.Byte[] buffer = new System.Byte[32*1024]();
    System.IO.MemoryStream ms = new System.IO.MemoryStream();

    read = input.Read(buffer, 0, buffer.Length);
    while (read > 0)
    {
        ms.Write(buffer, 0, read);
        read = input.Read(buffer, 0, buffer.Length);
    }
    return ms.ToArray();
}

public boolean validate()
{
    boolean ret = super();

    RetailFiscalIntegrationConnectorTable connectorTable;
    RetailFiscalIntegrationConfigurationValidationHelper validationHelper = new RetailFiscalIntegrationConfigurationValidationHelper();
    validationHelper.validateStructure(DevAxRefreshDataParameters.FIFManifestXml, connectorTable);

    return ret;
}

public void lookup(FormControl _formControl, str _filterStr)
{
    var sysEmailParameters = SysEmailParameters::find();

    SysMailerTmp sysMailerTmp;

    var mailers = SysMailerFactory::getMailers();

    for (var i = 1; i <= conLen(sysEmailParameters.MailerInteractiveEnabled); i++)
    {
        str mailerId = conPeek(sysEmailParameters.MailerInteractiveEnabled, i);

        if (mailers.exists(mailerId))
        {
            SysIMailer sysMailer = mailers.lookup(mailerId);

            sysMailerTmp.clear();
            sysMailerTmp.Id = sysMailer.getId();
            sysMailerTmp.Description = sysMailer.getDescription();
            sysMailerTmp.insert();
        }
    }

    sysMailerTmp.performFormLookup(_formControl);
}

public void OnUploadCompleted()
{
    super();
    AxxDocEInvoicePfxUploadResult axxDocEInvoicePfxUploadResult = this.getFileUploadResult();

    System.IO.Stream pfxMemoryStream = axxDocEInvoicePfxUploadResult.openResult();

    System.Byte[] asBytes = element.ReadFullyBytes(pfxMemoryStream);

    str AsBase64String = System.Convert::ToBase64String(asBytes);

    DevAxRefreshDataEInvoiceParameters.CertificateFile = axxDocEInvoicePfxUploadResult.getFileName();
    DevAxRefreshDataEInvoiceParameters.ECertificateStr  = AsBase64String;
}
